#include <windows.h>
#include <process.h>

struct MessageBoxArgs {
    const wchar_t* text;
    const wchar_t* caption;
    UINT type;
};

unsigned __stdcall ThreadedMessageBox(void* arguments) {
    MessageBoxArgs* args = static_cast<MessageBoxArgs*>(arguments);
    MessageBoxW(NULL, args->text, args->caption, args->type);
    delete args;
    return 0;
}

void CreateMessageBoxThread(const wchar_t* text, const wchar_t* caption, UINT type) {
    MessageBoxArgs* args = new MessageBoxArgs{text, caption, type};

    uintptr_t threadHandle = _beginthreadex(
        NULL,
        0,
        ThreadedMessageBox,
        args,
        0,
        NULL
    );

    if (threadHandle != 0) {
        CloseHandle((HANDLE)threadHandle);
    } else {
        delete args;
    }
}
